import React, { useState } from 'react';

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [noPosition, setNoPosition] = useState({ x: 0, y: 0 });
  const [answered, setAnswered] = useState(false);

  const noTexts = [
    "No",
    "Are you sure?",
    "Really?",
    "Think again!",
    "Don't be shy...",
    "Pretty please?",
    "Just click Yes!",
    "You know you want to...",
    "Last chance!",
    "Nope! Click Yes!",
    "I won't give up!",
    "Come on...",
    "Please? ü•∫"
  ];

  const handleNoHover = () => {
    setNoCount(prev => prev + 1);

    const maxX = 300;
    const maxY = 200;
    const newX = Math.random() * maxX - maxX / 2;
    const newY = Math.random() * maxY - maxY / 2;

    setNoPosition({ x: newX, y: newY });
  };

  const handleYes = () => {
    setAnswered(true);
  };

  if (answered) {
    return (
      <div style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #ffeef8 0%, #ffe0f0 50%, #ffd4e8 100%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Fredoka", "Comic Sans MS", cursive',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {/* Floating hearts */}
        {[...Array(15)].map((_, i) => (
          <div
            key={i}
            style={{
              position: 'absolute',
              fontSize: `${Math.random() * 30 + 20}px`,
              left: `${Math.random() * 100}%`,
              animation: `float ${Math.random() * 3 + 4}s ease-in-out infinite`,
              animationDelay: `${Math.random() * 2}s`,
              opacity: 0.6
            }}
          >
            üíñ
          </div>
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Fredoka:wght@400;600;700&display=swap');

          @keyframes float {
            0%, 100% { transform: translateY(0px) rotate(0deg); }
            50% { transform: translateY(-20px) rotate(10deg); }
          }
          @keyframes bounceIn {
            0% { transform: scale(0); opacity: 0; }
            50% { transform: scale(1.1); }
            100% { transform: scale(1); opacity: 1; }
          }
          @keyframes sparkle {
            0%, 100% { opacity: 0.3; transform: scale(0.8); }
            50% { opacity: 1; transform: scale(1.2); }
          }
        `}</style>

        <div style={{
          textAlign: 'center',
          background: 'white',
          padding: '60px 80px',
          borderRadius: '40px',
          boxShadow: '0 20px 60px rgba(255, 105, 180, 0.3)',
          animation: 'bounceIn 0.6s ease-out',
          position: 'relative',
          zIndex: 10,
          border: '4px solid #ffb6d9'
        }}>
          <div style={{ fontSize: '80px', marginBottom: '20px' }}>
            üéâüíï‚ú®
          </div>
          <h1 style={{
            fontSize: '56px',
            background: 'linear-gradient(135deg, #ff1493, #ff69b4, #ff85c1)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            marginBottom: '20px',
            fontWeight: 800,
            letterSpacing: '-1px'
          }}>
            Yay! Good Boy! üéä
          </h1>
          <p style={{
            fontSize: '28px',
            color: '#ff69b4',
            marginTop: '30px',
            fontWeight: 600
          }}>
            I knew you'd say yes! üíñ
          </p>
          <div style={{ fontSize: '50px', marginTop: '20px' }}>
            üòäüíùüåπ
          </div>
        </div>
      </div>
    );
  }

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #fff0f6 0%, #ffe8f0 50%, #ffd9e8 100%)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily: '"Fredoka", "Comic Sans MS", cursive',
      position: 'relative',
      overflow: 'hidden',
      padding: '20px'
    }}>
      {/* Cute decorative elements */}
      <div style={{
        position: 'absolute',
        top: '10%',
        left: '10%',
        fontSize: '60px',
        animation: 'float 3s ease-in-out infinite',
        opacity: 0.7
      }}>
        üíï
      </div>
      <div style={{
        position: 'absolute',
        top: '20%',
        right: '15%',
        fontSize: '50px',
        animation: 'float 4s ease-in-out infinite',
        animationDelay: '1s',
        opacity: 0.7
      }}>
        üåπ
      </div>
      <div style={{
        position: 'absolute',
        bottom: '15%',
        left: '8%',
        fontSize: '55px',
        animation: 'float 3.5s ease-in-out infinite',
        animationDelay: '0.5s',
        opacity: 0.7
      }}>
        üíñ
      </div>
      <div style={{
        position: 'absolute',
        bottom: '25%',
        right: '10%',
        fontSize: '50px',
        animation: 'float 4.5s ease-in-out infinite',
        animationDelay: '2s',
        opacity: 0.7
      }}>
        ‚ú®
      </div>
      <div style={{
        position: 'absolute',
        top: '40%',
        left: '5%',
        fontSize: '45px',
        animation: 'float 3.8s ease-in-out infinite',
        animationDelay: '1.5s',
        opacity: 0.7
      }}>
        üéÄ
      </div>
      <div style={{
        position: 'absolute',
        top: '60%',
        right: '8%',
        fontSize: '48px',
        animation: 'float 4.2s ease-in-out infinite',
        animationDelay: '0.8s',
        opacity: 0.7
      }}>
        üíù
      </div>

      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Fredoka:wght@400;600;700&display=swap');

        @keyframes float {
          0%, 100% { transform: translateY(0px) rotate(0deg); }
          50% { transform: translateY(-15px) rotate(5deg); }
        }

        @keyframes pulse {
          0%, 100% { transform: scale(1); }
          50% { transform: scale(1.05); }
        }

        @keyframes heartbeat {
          0%, 100% { transform: scale(1); }
          25% { transform: scale(1.1); }
          50% { transform: scale(1); }
          75% { transform: scale(1.15); }
        }

        .yes-button {
          transition: all 0.3s ease;
        }

        .yes-button:hover {
          transform: scale(1.15) rotate(-3deg);
          box-shadow: 0 10px 40px rgba(255, 20, 147, 0.4);
        }

        .no-button {
          transition: all 0.2s ease;
        }
      `}</style>

      <div style={{
        textAlign: 'center',
        background: 'white',
        padding: '60px 50px',
        borderRadius: '35px',
        boxShadow: '0 15px 50px rgba(255, 105, 180, 0.25)',
        maxWidth: '600px',
        position: 'relative',
        border: '3px solid #ffb3d9'
      }}>
        {/* Cute hearts around the box */}
        <div style={{
          position: 'absolute',
          top: '-20px',
          left: '-20px',
          fontSize: '40px',
          animation: 'heartbeat 1.5s ease-in-out infinite'
        }}>
          üíó
        </div>
        <div style={{
          position: 'absolute',
          top: '-20px',
          right: '-20px',
          fontSize: '40px',
          animation: 'heartbeat 1.5s ease-in-out infinite',
          animationDelay: '0.3s'
        }}>
          üíó
        </div>
        <div style={{
          position: 'absolute',
          bottom: '-20px',
          left: '-20px',
          fontSize: '40px',
          animation: 'heartbeat 1.5s ease-in-out infinite',
          animationDelay: '0.6s'
        }}>
          üíó
        </div>
        <div style={{
